import React from 'react'
import Header from "./Header";


function Test() {
    return(
        <div>
              <Header />
              {
                  (typeof data.users === 'undefined') ? (<p>Loading...</p>):(
                      data.users.map((user, i) => (
                        <p key={i}>{user.name}</p>
                    )
                  )
                )
              }

          </div>
  )
}

export default Test
